svg.script:
var lines = ["Flusso_649", "Flusso_656", "Flusso_631", "Flusso_637", "Flusso_644", "Flusso_655", "Flusso_665", "Flusso_641", "Flusso_658", "Flusso_651", "Flusso_661", "Flusso_639", "Flusso_634", "Flusso_646", "Flusso_648", "Flusso_657", "Flusso_633", "Flusso_643", "Flusso_652", "Flusso_664", "Flusso_629", "Flusso_640", "Flusso_660", "Flusso_636", "Flusso_635", "Flusso_663", "Flusso_654", "Flusso_630", "Flusso_642", "Flusso_659", "Flusso_650", "Flusso_653", "Flusso_645", "Flusso_666", "Flusso_632", "Flusso_662", "Flusso_638", "Flusso_647"];
var devices = [["md440", "ul74"], ["p440b", "ritornos410exit"], ["p440b", "ul72"], ["p440b", "ul71"], ["k441", "exit"], ["p440a", "ritornos410exit"], ["K2CO3.txtkohstart", "lv-201"], ["polveristart", "r440"], ["mc-492a", "mc-492b"], ["mc-445start", "md440"], ["ms441sstart", "p442b"], ["fv106", "r440"], ["ul70", "fv205"], ["r440", "mc-443"], ["p442b", "ul70"], ["me-440", "mc-492a"], ["r440", "condottofumiexit"], ["r440", "mc-440"], ["mc-446start", "md440"], ["lv-201", "p440a"], ["ul72", "ams441"], ["generatoregasdiprocessostart", "r440"], ["ariaambientestart", "ul73"], ["p440a", "ul71"], ["ul71", "fv205"], ["mc-492b", "K2CO3.txtexit2"], ["mc-443", "md440"], ["p440a", "ul72"], ["mc442start", "r440"], ["ms441sstart", "p442a"], ["md440", "me-440"], ["k440", "md440"], ["ul74", "k441"], ["lv-201", "p440b"], ["ai9start", "fv106"], ["ul73", "k440"], ["fv205", "r440"], ["p442a", "ul70"]];
var elementLines = [];
var elementDevices = [];
var n = [];
var nD = [];
function highlight(className, value, display) {
    document.getElementById(className.baseVal).setAttribute("display", display);
    for(var i = 0; i <  n[className.baseVal]; i ++) {
        elementLines[className.baseVal][i].setAttribute("stroke-width", value);
    }
    for(var i = 0; i < nD[className.baseVal]; i++) {
        elementDevices[className.baseVal][i].setAttribute("stroke-width", value);
    }
}
for(var i = 0; i < lines.length; i++) {
    var currentClass = lines[i];
    elementLines[currentClass] = document.getElementsByClassName(currentClass);
    n[currentClass] = elementLines[currentClass].length;
    nD[currentClass] = devices[i].length;
    elementDevices[currentClass] = [];
    for(var j = 0; j < nD[currentClass]; j++) {
        elementDevices[currentClass][j] = document.getElementById(devices[i][j]);
    }
    for(var k = 0; k < n[currentClass]; k++) {
        elementLines[currentClass][k].onmouseover = function() {
            highlight(this.className, "7", "block");
        };
        elementLines[currentClass][k].onmouseout = function() {
            highlight(this.className, "3", "none");
        };
    }
};
